// === Voice Agent JSON Sanitiser ===
// Input: Raw text from the LLM (might include backticks or markdown)
// Output: Clean JSON object { status, agent_prompt }

let raw = $json.output || $json.data || $input.item.json.text || "";
raw = raw.trim();

// Step 1: Remove Markdown wrappers and non-JSON text
// Removes ```json, ```, and stray Markdown artifacts
raw = raw
  .replace(/^```json/i, "")
  .replace(/^```/, "")
  .replace(/```$/, "")
  .replace(/[\u0000-\u001F]+/g, " ") // remove control chars
  .trim();

// Step 2: If there's extra text around JSON, try to isolate it
const firstBrace = raw.indexOf("{");
const lastBrace = raw.lastIndexOf("}");
if (firstBrace > -1 && lastBrace > firstBrace) {
  raw = raw.slice(firstBrace, lastBrace + 1);
}

// Step 3: Try to parse JSON safely
let parsed;
try {
  parsed = JSON.parse(raw);
} catch (err) {
  // Step 4: Attempt quick repairs for unescaped quotes or newlines
  let repaired = raw
    .replace(/\n+/g, " ")
    .replace(/\r+/g, " ")
    .replace(/\\(?!["\\/bfnrtu])/g, "\\\\") // escape stray backslashes
    .replace(/‚Äú|‚Äù/g, '"') // smart quotes
    .replace(/‚Äò|‚Äô/g, "'"); // smart apostrophes

  try {
    parsed = JSON.parse(repaired);
  } catch (e2) {
    // Step 5: Fallback error-safe response
    return [
      {
        json: {
          status: "error",
          message: "Invalid or unrepairable JSON from Voice Agent Creation Agent",
          raw_response: raw
        }
      }
    ];
  }
}

// Step 6: Ensure structure matches the expected schema
if (!parsed || typeof parsed !== "object") {
  return [
    {
      json: {
        status: "error",
        message: "Voice Agent Creation Agent output not an object",
        raw_response: raw
      }
    }
  ];
}

if (!parsed.agent_prompt || typeof parsed.agent_prompt !== "string") {
  parsed.status = "error";
  parsed.message = "Missing or invalid agent_prompt field";
}

// Step 7: Clean up the agent_prompt text
if (parsed.agent_prompt) {
  parsed.agent_prompt = parsed.agent_prompt
    .replace(/\s+/g, " ")
    .replace(/\\n/g, " ")
    .replace(/["]+/g, '"')
    .trim();
}

// Step 8: Return clean JSON object
return [
  {
    json: {
      status: parsed.status || "success",
      agent_prompt: parsed.agent_prompt || "",
      validated: true
    }
  }
];

